- input: "TEXT\x1CC00488742\x1C1\x1C\x1CF3XA\x1C1/16/13:  We are amending our 30-Day
    Post General Election report filed on 12/05/2012 to update Line 11a to disclose
    two receipts from the National Association of Realtors which will, in effect,
    increase our total receipts Line 6c, as well as Line 8, which reflects our final
    total cash on hand.  These two contributions were made right after the 12-Day
    Pre-Election Report cut-off,and, simply put, inadvertently left off the 30-Day
    Post General Election report covering the period of 10/18/2012 to 11/26/2012.
    This amendment corrects that error. All other aspects of this report remain the
    same.\n"
